//men hvis personen som lager denne siden er uenig i det er det bare å si ifra

import React from 'react';
import { Link } from "react-router-dom";


function importAll(r) {
    return r.keys().map(r);
  }

function CategoryPage(props) {
    const listOfImages=importAll(require.context('./../images/things', false, /\.(png|jpe?g|svg)$/));
    console.log(listOfImages[0])
    return (
        <div className="Page">
            <p>CategoryPage</p>
            <img src={listOfImages[0]}/>
            <p>{props.location.state.category}</p>
            <Link to="/cards"><p>Cards</p></Link>
        </div>
    );
}

export default CategoryPage;
